import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation

function Register() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState('');

  const handleRegister = (e) => {
    e.preventDefault();

    if (!name || !email || !password || !confirmPassword) {
      setError('All fields are required');
      return;
    }

    if (password !== confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    console.log('Registering user with:', { name, email, password });
  };

  return (
    <form onSubmit={handleRegister}>
      {error && <div className="alert alert-danger" role="alert">{error}</div>}

      {/* Name input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="text" 
          id="form3Example1" 
          className="form-control" 
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example1">Full Name</label>
      </div>

      {/* Email input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="email" 
          id="form3Example2" 
          className="form-control"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example2">Email address</label>
      </div>

      {/* Password input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="password" 
          id="form3Example3" 
          className="form-control"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example3">Password</label>
      </div>

      {/* Confirm Password input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="password" 
          id="form3Example4" 
          className="form-control"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example4">Confirm Password</label>
      </div>

      {/* Submit button */}
      <button type="submit" className="btn btn-primary btn-block mb-4">Register</button>

      {/* Login Link */}
      <div className="text-center">
        <p>Already a member? <Link to="/login">Login</Link></p>
      </div>
    </form>
  );
}

export default Register;
